export function changeActive(){toggleAttr.call(this,"aria-expanded"),this.classList.toggle("active")}export function toggleAttr(t){"true"===this.getAttribute(t)?this.setAttribute(t,"false"):this.setAttribute(t,"true")}export function setAttr(t,e){this.setAttribute(t,e)}export function addEventListenerToElements(t,e,i,...n){const r=[];return t?.length&&t.forEach(((t,s)=>{r[s]=e.bind(t,...n),t.addEventListener(i,r[s])})),r}